  useEffect(() => {
    console.log('useEffect');
    const fetch = async () => {
      const { data } = await axios.get('https://swapi.co/api/films/1/');
      setStartWars(data);
    };
    fetch();
  }, []);

  return (
    <div className='App'>
      <h1>Simple Fetch Data</h1>
    </div>
  );
}

